import React, {useEffect, useState} from "react";
import styles from "react";
import {getContainer} from "../../utils/api";
import {useRouter} from "next/router";
import Container from "../../../api/schemas/containerSchema";

const initialState = {
  container: null,
  isLoading,
};

export function ShowContainer() {
  const [state, setState] = useState(initialState);
  const router = useRouter();
  let id = router.query.bookContainer;
  console.log(id);

  useEffect(() => {
    async function fetch() {
      try {
        setState({...state, isLoading: true});
        if (id) {
          const response = await getContainer(id);
          console.log(response.data);
          if (response.data) {
            setState({...state, container: response.data});
          }
        }
      } catch (error) {
        console.log(error);
      }
    }
    fetch();
  }, [id]);

  return (
    <div className={styles.wrapper}>
      <p>{state.container.price}</p>
      <p>{}</p>
    </div>
  );
}
